import React, { Component } from 'react';
import "./LineGraph.css";
import $ from 'jquery';
 class LineGraph extends Component {
   componentDidMount(){
    $(function() {
      for (var i = 0; i < $(".vert-bars .data li").length; ++i) {
          $(".vert-bars .bar:eq(" + i + ")").animate({
              height: $(".vert-bars .value:eq(" + i + ")").html()
          }, 500);
      }
  });
   }
    render() {
        
        return (
          <div class="vert-bars">
          <div class="chart-title">Vote Results</div>
          
          
          <div class="axis-title">Percentage</div>
          
         
          <div class="scale-labels">
              <span>100</span>
              <span>90</span>
              <span>80</span>
              <span>70</span>
              <span>60</span>
              <span>50</span>
              <span>40</span>
              <span>30</span>
              <span>20</span>
              <span>10</span>
              <span>0</span>
          </div>
              
          <ul class="data">
              <li>
                  <span class="value">60%</span>
                  <div class="bar"></div>
              </li>
              <li>
                  <span class="value">30%</span>
                  <div class="bar"></div>
              </li>
              <li>
                  <span class="value">10%</span>
                  <div class="bar"></div>
              </li>
          </ul>
          <ul class="labels">
              <li>Yes</li><li>No</li><li>Not sure</li>
          </ul>
      </div>
        );
    }
}export default LineGraph;
